import './ItemPrize.css';


function ItemPrize(){

    const day=20;
    const month= 'August';
    const year =2022;

     return (
<div className='itemprize'>
   
<span> {day}</span>
<span> {month}</span>
<span> {year}</span>

</div>

     );
}

export default ItemPrize;
